// Result.js
import React from "react";
import "./index.css";

const Result = (props) => {
  const img = `https://source.unsplash.com/random/400x300/?${props.name}`;

  return (
    <>
      <img src={img} alt="Search Result" className="result-img" />
    </>
  );
};

export default Result;
